CREATE DEFINER=`root`@`localhost` PROCEDURE `check_unpaid_by_found_item`(IN `it_id` INT, IN `status_codes` VARCHAR(255))
BEGIN
SELECT `phppos_items`.*, `phppos_categories`.`name` as `category`, `phppos_categories`.`id` as `category_id` 
FROM `phppos_items` 
LEFT JOIN `phppos_categories` ON `phppos_categories`.`id` = `phppos_items`.`category_id` 
WHERE `phppos_items`.`deleted` =0 AND `phppos_items`.`owner_payment_id` is null AND `phppos_items`.item_id not in(SELECT item_id from phppos_payments WHERE `phppos_payments`.`item_type` = 1 and `phppos_payments`.`deleted` = 0 and  FIND_IN_SET(payment_gatway_code,status_codes)) and `phppos_items`.`item_id` = it_id;
   END$$
DELIMITER ;

